import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {

  let text = 'Welcome to my website. Check out my previous work and active projects below';

  const typingEffect = (text) => {
    const textArray = text.split('');
    textArray.forEach((letter, i) => {
      setTimeout(() => {
        console.log(letter);
      }, 100 * i);
    });
  };

  typingEffect(text);

  console.log('App component rendered');
  return (
    <div className="min-h-screen flex flex-col">
      <Header />
      <main className="p-4">
        <p id="welcome-text">Welcome to my website.<br></br>Check out my previous work and active projects below</p>
      </main>
      <Footer />
    </div>
  );
}

export default App;
